    (rows, cols) = (len(grid), len(grid[0]))
    dp = [[None] * cols for _ in range(rows)]
    dp[0][0] = (grid[0][0], grid[0][0])
    for j in range(1, cols):
        dp[0][j] = (dp[0][j - 1][0] * grid[0][j] % MOD, dp[0][j - 1][1] * grid[0][j] % MOD)
    for i in range(1, rows):
        dp[i][0] = (dp[i - 1][0][1] * grid[i][0] % MOD, dp[i - 1][0][1] * grid[i][0] % MOD)
    for i in range(1, rows):
        for j in range(1, cols):
            nums = [dp[i - 1][j][0] * grid[i][j], dp[i - 1][j][1] * grid[i][j], dp[i][j - 1][0] * grid[i][j], dp[i][j - 1][1] * grid[i][j]]
            dp[i][j] = (max(nums) % MOD, min(nums) % MOD)
    maxVal = dp[-1][-1][0]
    return maxVal if maxVal >= 0 else -1

